CREATE DATABASE super_hero;
USE super_hero;

/*Create tables*/
CREATE TABLE user(
	id_user INT PRIMARY KEY auto_increment,
	username VARCHAR(20) UNIQUE NOT NULL,
    email VARCHAR(255) UNIQUE NOT NULL,
    password VARCHAR(255) NOT NULL
);

CREATE TABLE hero(
	id_hero INT PRIMARY KEY auto_increment,
    nome VARCHAR(255) NOT NULL,
    id_login INT,
    dt_cad DATETIME DEFAULT NOW() NOT NULL,
    FOREIGN KEY (id_login) REFERENCES user(id_user)
);

CREATE TABLE universe(
	id_universe INT PRIMARY KEY AUTO_INCREMENT,
	universe VARCHAR(255) NOT NULL
);

CREATE TABLE power(
 id_power INT PRIMARY KEY auto_increment,
 power VARCHAR(255) 
);

CREATE TABLE hero_power_universe(
	id_hero_power_universe INT PRIMARY KEY auto_increment,
    id_power INT,
    id_universe INT,
    id_hero INT NOT NULL,
    FOREIGN KEY (id_power) REFERENCES power(id_power),
    FOREIGN KEY (id_universe) REFERENCES universe(id_universe),
    FOREIGN KEY (id_hero) REFERENCES hero(id_hero)
);

/*Selects*/
SELECT * FROM power;
SELECT * FROM hero;
SELECT * FROM hero_power_universe;
SELECT * FROM universe;
SELECT * FROM user;

/*power
hero
hero_power_universe
universe*/

SELECT nome, universe, power, dt_cad FROM hero
INNER JOIN hero_power_universe
 ON hero.id_hero = hero_power_universe.id_hero
INNER JOIN power
 ON power.id_power = hero_power_universe.id_power
INNER JOIN universe
 ON universe.id_universe = hero_power_universe.id_universe
 order by nome ASC LIMIT 10000;
 
 


